// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;
interface IERC20 {

    event Transfer(address indexed from, address indexed to, uint256 value);


    event Approval(address indexed owner, address indexed spender, uint256 value);


    function totalSupply() external view returns (uint256);


    function balanceOf(address account) external view returns (uint256);


    function transfer(address to, uint256 amount) external returns (bool);


    function allowance(address owner, address spender) external view returns (uint256);


    function approve(address spender, uint256 amount) external returns (bool);


    function transferFrom(
        address from,
        address to,
        uint256 amount
    ) external returns (bool);
}

pragma solidity ^0.8.0;
interface IERC165 {

    function supportsInterface(bytes4 interfaceId) external view returns (bool);
}
pragma solidity ^0.8.0;
interface IERC1155 is IERC165 {

    event TransferSingle(address indexed operator, address indexed from, address indexed to, uint256 id, uint256 value);


    event TransferBatch(
        address indexed operator,
        address indexed from,
        address indexed to,
        uint256[] ids,
        uint256[] values
    );


    event ApprovalForAll(address indexed account, address indexed operator, bool approved);


    event URI(string value, uint256 indexed id);


    function balanceOf(address account, uint256 id) external view returns (uint256);


    function balanceOfBatch(address[] calldata accounts, uint256[] calldata ids)
        external
        view
        returns (uint256[] memory);


    function setApprovalForAll(address operator, bool approved) external;


    function isApprovedForAll(address account, address operator) external view returns (bool);


    function safeTransferFrom(
        address from,
        address to,
        uint256 id,
        uint256 amount,
        bytes calldata data
    ) external;


    function safeBatchTransferFrom(
        address from,
        address to,
        uint256[] calldata ids,
        uint256[] calldata amounts,
        bytes calldata data
    ) external;
}
pragma solidity ^0.8.4;
interface i1155 {
    struct NFTEA {
        uint256 nftea;
        address[] addresses;
        uint256[] settings;
    }
    struct OP{
        address operator;
        address wallet;
        uint256 label;
        uint256 license;
        uint256 expire;
        uint256 wdays;
        uint256 nextwithdraw;
        uint256 wamount1;
        uint256 wamount2;
        uint256 role;
    }
    function gflame(string memory flame_) external pure returns(address);
    function getoperator(address operator_, uint256 license_) external pure returns(uint256[4] memory,uint256[] memory,uint256,uint256,uint256,uint256,address);
    function fire(address caller_) external pure returns(uint256[] memory,uint256[] memory,uint256,bool,bool,uint256);
    function removeoperator(address operator_, uint256 opid_) external returns(bool);
    function getnftea(uint256 nftea_) external pure returns(NFTEA memory,string[] memory, string memory);
    function getoperatorlicenses(address operator_) external pure returns(uint256[] memory);
    // function getbag(uint256 nftea_, address wallet_, address profile_) external pure returns(address, uint256, uint256);
    function getoperatorrole(uint256 opid_) external view returns(uint256);
    function setoperator(uint256 labelnftea_, address operator_, address wallet_, uint256 license_, uint256 expire_, uint256 role_) external returns(bool);
    function setwithdrawsettings(uint256[] memory numbers_, address operator_,uint256 nftea_) external returns(bool);
    function setrole(uint256 nftea2operate_, uint256 license_, uint256 role_, address operator_) external returns(bool);
    function setWithdrawTokenLimit(address wallet_, address operator_, address token_, uint256 limit_) external returns(bool);
    function setWithdrawNFTLimit(address wallet_, address operator_, address nftcontract_, uint256 nftid_, uint256 limit_) external returns(bool);
    function getop(uint256 opid_) external pure returns(OP memory);
    function setTokenDecimal(address token_, uint256 decimal_) external returns(bool);
}
contract operatorlogic {

    string public name = "OPERATOR LOGIC V1";
    address public _fire;
    i1155.NFTEA _nfteas;
    i1155.OP _op;

    constructor(address fire_){
        _fire = fire_;
    }

    function setoperator(uint256 labelnftea_, address operator_, address wallet_, uint256 license_, uint256 expire_,uint256 role_) public{

        //get operator
        //validate operator is super operator role 1
        (address flame_) = i1155(_fire).gflame('operatorstorage');
        //validate operator
        (,,uint256 opid_, uint256 expirex_,,,) = i1155(flame_).getoperator(msg.sender,labelnftea_);
        require(opid_>0, 'invalid operator');
        require(expirex_ > block.timestamp || expirex_==0, 'operator license expired');

        (uint256 rolex_)= i1155(flame_).getoperatorrole(opid_);
        require(rolex_==1, 'you are not a super oerpertor');
        (flame_) = i1155(_fire).gflame('mintcontract');
        //make sure super op has license to send
        uint256 balance1 = IERC1155(flame_).balanceOf(msg.sender,license_);
        require(balance1>0, 'check license');
        uint256 balance = IERC1155(flame_).balanceOf(operator_,license_);
        if(balance<1){
          IERC1155(flame_).safeTransferFrom(msg.sender,operator_,license_, 1,'');
          require(checkSuccess(), 'sale transfer failed');
        }
        (flame_) = i1155(_fire).gflame('operatorstorage');
        (bool success) = i1155(flame_).setoperator(labelnftea_,operator_,wallet_,license_,expire_,role_);
        require(success, 'error setting operator');

    }

    function setwithdrawsettings(uint256[] memory numbers_,address operator_,uint256 nftea_) public{
        //0 = wlimittea_
        //1 = wlimitbnb_
        //2 = wfreq_
        //3 = nextwithraw
        //4 = wexpire_
        //5 = license_
        if(numbers_[4]>0){
          numbers_[4] = numbers_[4] * 24 hours;
        }
        if(numbers_[0]>0){
          numbers_[0] = numbers_[0]*10**9;
        }
        if(numbers_[1]>0){
          numbers_[1] = numbers_[1]*10**9;
        }
        (address flame_) = i1155(_fire).gflame('operatorstorage');
        //validate operator
        (,,uint256 opid_,uint256 expire_,,,address wallet_) = i1155(flame_).getoperator(msg.sender,nftea_);
        require(opid_>0, 'invalid operator');
        require(expire_ > block.timestamp || expire_==0, 'operator license expired');
        (uint256 rolex_)= i1155(flame_).getoperatorrole(opid_);
        require(rolex_==1, 'you are not a super oerpertor');
        (_op) = i1155(flame_).getop(opid_);
        if(_op.license!=_op.label){
          require(_op.operator != msg.sender, 'cannot edit your own settings');
          require(operator_!=_op.operator, 'cannot edit lead operator');
        }
        (bool success) = i1155(flame_).setwithdrawsettings(numbers_,operator_,nftea_);
        require(success, 'error setting operator');
        if(numbers_[0]>0){
          (address token_) = i1155(_fire).gflame('teatoken');
          (flame_) = i1155(_fire).gflame('bagstorage');
          (success) = i1155(flame_).setWithdrawTokenLimit(wallet_,operator_,token_,numbers_[0]);
          require(success, 'error setting token withdraw limit');
        }

    }
    function setWithdrawTokenLimit(uint256 license_, address wallet_, address operator_, address token_, uint256 limit_) public {

      (address flame_) = i1155(_fire).gflame('operatorstorage');
      //validate operator
      (,,uint256 opid_,uint256 expire_,,,) = i1155(flame_).getoperator(msg.sender,license_);
      require(opid_>0, 'invalid operator');
      require(expire_ > block.timestamp || expire_==0, 'operator license expired');
      (uint256 rolex_)= i1155(flame_).getoperatorrole(opid_);
      require(rolex_==1, 'you are not a super oerpertor');
      (_op) = i1155(flame_).getop(opid_);
      if(_op.license!=_op.label){
        require(_op.operator != msg.sender, 'cannot edit your own settings');
        require(operator_!=_op.operator, 'cannot edit lead operator');
      }
      (flame_) = i1155(_fire).gflame('bagstorage');
      (bool success) = i1155(flame_).setWithdrawTokenLimit(wallet_,operator_,token_,limit_);
      require(success, 'error setting token withdraw limit');

    }
    function setWithdrawNFTLimit(uint256 license_, address wallet_, address operator_, address nftcontract_, uint256 nftid_, uint256 limit_) public {

      (address flame_) = i1155(_fire).gflame('operatorstorage');
      //validate operator
      (,,uint256 opid_,uint256 expire_,,,) = i1155(flame_).getoperator(msg.sender,license_);
      require(opid_>0, 'invalid operator');
      require(expire_ > block.timestamp || expire_==0, 'operator license expired');
      (uint256 rolex_)= i1155(flame_).getoperatorrole(opid_);
      require(rolex_==1, 'you are not a super oerpertor');
      (_op) = i1155(flame_).getop(opid_);
      if(_op.license!=_op.label){
        require(_op.operator != msg.sender, 'cannot edit your own settings');
        require(operator_!=_op.operator, 'cannot edit lead operator');
      }
      (flame_) = i1155(_fire).gflame('bagstorage');
      (bool success) = i1155(flame_).setWithdrawNFTLimit(wallet_,operator_,nftcontract_,nftid_,limit_);
      require(success, 'error setting nft withdraw limit');
    }
    function setrole(uint256 nftea2operate_, uint256 role_, uint256 license_, address operator_) public {

        (address flame_) = i1155(_fire).gflame('operatorstorage');
        //validate operator
        (,,uint256 opid_, uint256 expirex_,,,) = i1155(flame_).getoperator(msg.sender,license_);
        require(opid_>0, 'invalid operator');
        require(expirex_ > block.timestamp || expirex_==0, 'operator license expired');
        (uint256 rolex_)= i1155(flame_).getoperatorrole(opid_);
        require(rolex_==1, 'you are not a super oerpertor');
        (_op) = i1155(flame_).getop(opid_);
        if(_op.license!=_op.label){
          require(_op.operator != msg.sender, 'cannot edit your own settings');
          require(operator_!=_op.operator, 'cannot edit lead operator');
        }
        (bool success) = i1155(flame_).setrole(nftea2operate_,license_, role_, operator_);
        require(success, 'error setting role');
    }
    function removeoperator(address operator_,uint256 license_) public{

        (address flame_) = i1155(_fire).gflame('operatorstorage');
        //validate operator
        (,,uint256 opidx_, uint256 expirex_,,,) = i1155(flame_).getoperator(msg.sender,license_);
        require(opidx_>0, 'invalid operator');
        require(expirex_ > block.timestamp || expirex_==0, 'operator license expired');
        (uint256 role_)= i1155(flame_).getoperatorrole(opidx_);
        require(role_==1, 'you are not a super oerpertor');
        (_op) = i1155(flame_).getop(opidx_);
        if(_op.license!=_op.label){
          require(operator_!=_op.operator, 'cannot edit lead operator');
        }
        (bool success) = i1155(flame_).removeoperator(operator_, opidx_);
        require(success, 'error setting operator');

    }
    function getoperator(address operator_, uint256 license_) public returns(uint256[] memory, uint256[4] memory,uint256,uint256,address){

        (address flame_) = i1155(_fire).gflame('operatorstorage');
        (uint256[4] memory wsettings_,, uint256 opid_,uint256 expire_,,, address wallet_) = i1155(flame_).getoperator(operator_,license_);
        (flame_) = i1155(_fire).gflame('mintstorage');
        (_nfteas,,) = i1155(flame_).getnftea(license_);

        return(_nfteas.settings,wsettings_,opid_, expire_,wallet_);
    }
    function getoperatorlicenses(address operator_) public view returns(uint256[] memory){

        (address flame_) = i1155(_fire).gflame('operatorstorage');
        (uint256[] memory ops_) = i1155(flame_).getoperatorlicenses(operator_);
        return ops_;

    }
    function checkSuccess()
    private pure
    returns (bool)
    {
        uint256 returnValue = 0;

        /* solium-disable-next-line security/no-inline-assembly */
        assembly {
        // check number of bytes returned from last function call
            switch returndatasize()

            // no bytes returned: assume success
            case 0x0 {
                returnValue := 1
            }

            // 32 bytes returned: check if non-zero
            case 0x20 {
            // copy 32 bytes into scratch space
                returndatacopy(0x0, 0x0, 0x20)

            // load those bytes into returnValue
                returnValue := mload(0x0)
            }

            // not sure what was returned: dont mark as success
            default { }

        }

        return returnValue != 0;
    }
}
